import React from "react";
import '../App.css';
import Top from './Top.js';
import { Route, Routes } from "react-router-dom";
import SearchBar from "./SearchBar";
import logo from  '../logo_biblioteca.jpg';
import icon_perfil from '../icon_perfil.jpg';

function Libros(){
    return(
        <Routes>
            <Route path="/Libros" exact>
                        
            <div className="container">
                <div className='logo'> 
                    <a  href="/" class="btn btn-outline-light text-dark" type="button"><img src={logo} width='65' alt= 'Logo'/></a>
                </div>

                <div className='header'><SearchBar/></div>

                <div className='profile'>    
                    <button type="button" class="btn dropdown-toggle btn-outline-light text-dark" data-bs-toggle="dropdown"><img src={icon_perfil} width='65' alt= 'Icon_Perfil'/> </button>
                    <div class="dropdown-menu">
                    <a class="dropdown-item" href="/Sign in">Sign in</a>
                    <a class="dropdown-item" href="/Sign up">Sign up</a>

                    </div>
                </div>

                
            </div>
            </Route>
        </Routes>
    )
}

export default Libros;
